import Link from "next/link";

export default function Navbar() {
  return (
    <ul className="navbar">
      <li>
        <Link href="/">
          <a>HOME</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>ABOUT</a>
        </Link>
      </li>
      <li>
        <Link href="/contact">
          <a>CONTACT</a>
        </Link>
      </li>
      <li>
        <Link href="/gallery">
          <a>GALLERY</a>
        </Link>
      </li>
      <style jsx>{`
        .navbar {
          background-color: #212121;
          overflow: hidden;
          color: #454545;
          font-size: 25px;
          font-weight: 500;
          font-family: Cinzel;
          position: fixed;
          top: 0;
          display: block;
          width: 100%;
          z-index: 100;
        }
        .navbar a {
          float: left;
          display: block;
          color: #454545;
          text-decoration: none;
          text-align: center;
        }
      `}</style>
    </ul>
  );
}
